import { ImageButton } from './components/ImageButton/ImageButton';
import { SmallCard } from './components/SmallCard/SmallCard';

const pageSection1 = {
  titulo: "Titulo"
}

const pageSection2 = {
  titulo: "Titulo"
}



function App() {
  return (
    <div className="App">
      <PageSection titulo={pageSection1.titulo} />
      <BigCard/>
      <SmallCard/>
      <SmallCard/>
      <ImageButton/>
      <PageSection titulo={pageSection2.titulo} />
    </div>
  );
}

export default App;
